const dataLoading = (state = [], action) => {

    switch(action.type) {

        case 'TOOGLE_ISDATALOADED_LEFTPANEL':
            var rep = {
                ...state,
                isLeftDataLoaded: !state.isLeftDataLoaded
            };
            console.log("Received by Data reducer : "+rep);
            return rep;

        case 'TOOGLE_ISDATALOADED_RIGHTPANEL':
            var rep = {
                ...state,
                isRightDataLoaded: !state.isRightDataLoaded
            };
            console.log("Received by Data reducer : "+rep);
            return rep;

        default: 
            return state;
    }

}

export default dataLoading;
